import { useState } from "react";
import { FaFacebookF, FaTwitter, FaInstagram, FaLinkedin } from "react-icons/fa";

export default function Footer() {
  const [email, setEmail] = useState("");
  const [message, setMessage] = useState("");

  const handleSubscribe = (e) => {
    e.preventDefault();
    if (!email.includes("@")) {
      setMessage("Please enter a valid email üòÖ");
      return;
    }
    setMessage(`Thank you for subscribing, ${email}! üéâ`);
    setEmail("");
  };

  return (
    <footer style={styles.footer}>
      {/* Newsletter Section */}
      <div style={styles.newsletter}>
        <h3 style={styles.newsTitle}>Subscribe to Our Newsletter</h3>
        <p style={styles.newsText}>Get updates on new arrivals, offers & trending books üìö</p>
        <form onSubmit={handleSubscribe} style={styles.newsForm}>
          <input
            type="email"
            placeholder="Enter your email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            style={styles.newsInput}
          />
          <button type="submit" style={styles.newsButton}>Subscribe</button>
        </form>
        {message && <p style={styles.newsMessage}>{message}</p>}
      </div>

      {/* Main Footer Content */}
      <div style={styles.container}>
        {/* Quick Links */}
        <div style={styles.section}>
          <h4 style={styles.heading}>Quick Links</h4>
          <ul style={styles.list}>
            <li style={styles.listItem} onClick={() => window.location.href = "/"}>Home</li>
            <li style={styles.listItem} onClick={() => window.location.href = "/cart"}>Cart</li>
            <li style={styles.listItem} onClick={() => window.location.href = "/categories"}>Categories</li>
            <li style={styles.listItem} onClick={() => window.location.href = "/about"}>About Us</li>
            <li style={styles.listItem} onClick={() => window.location.href = "/contact"}>Contact</li>
          </ul>
        </div>

        {/* Contact Info */}
        <div style={styles.section}>
          <h4 style={styles.heading}>Contact Us</h4>
          <p style={styles.text}>üìç 123 Book Street, Chennai, India</p>
          <p style={styles.text}>üìß support@bookstore.com</p>
          <p style={styles.text}>üìû +91 12345 67890</p>
        </div>

        {/* Social Media */}
        <div style={styles.section}>
          <h4 style={styles.heading}>Follow Us</h4>
          <div style={styles.socialIcons}>
            <FaFacebookF style={styles.icon} />
            <FaTwitter style={styles.icon} />
            <FaInstagram style={styles.icon} />
            <FaLinkedin style={styles.icon} />
          </div>
        </div>
      </div>

      {/* Copyright */}
      <div style={styles.copy}>
        &copy; {new Date().getFullYear()} BookStore. All rights reserved.
      </div>
    </footer>
  );
}

const styles = {
  footer: {
    backgroundColor: "#ff6f61",
    color: "#fff",
    padding: "40px 20px 20px 20px",
    fontFamily: "'Poppins', sans-serif",
  },
  newsletter: {
    textAlign: "center",
    marginBottom: "30px",
  },
  newsTitle: {
    fontSize: "20px",
    fontWeight: 600,
    marginBottom: "8px",
  },
  newsText: {
    fontSize: "14px",
    marginBottom: "15px",
  },
  newsForm: {
    display: "flex",
    justifyContent: "center",
    flexWrap: "wrap",
    gap: "10px",
  },
  newsInput: {
    padding: "12px 15px",
    borderRadius: "8px",
    border: "none",
    fontSize: "14px",
    outline: "none",
    flex: "1 1 250px",
  },
  newsButton: {
    padding: "12px 20px",
    borderRadius: "8px",
    border: "none",
    backgroundColor: "#fff",
    color: "#ff6f61",
    fontWeight: 600,
    cursor: "pointer",
    transition: "all 0.3s",
  },
  newsButtonHover: {
    backgroundColor: "#ffdcdc",
    transform: "scale(1.05)",
  },
  newsMessage: {
    marginTop: "10px",
    fontSize: "14px",
    color: "#fff",
  },
  container: {
    display: "flex",
    flexWrap: "wrap",
    justifyContent: "space-between",
    gap: "20px",
    maxWidth: "1200px",
    margin: "0 auto",
  },
  section: {
    flex: "1 1 200px",
  },
  heading: {
    fontSize: "18px",
    marginBottom: "12px",
    fontWeight: 600,
    borderBottom: "2px solid rgba(255,255,255,0.3)",
    display: "inline-block",
    paddingBottom: "4px",
  },
  list: {
    listStyle: "none",
    padding: 0,
    margin: 0,
  },
  listItem: {
    marginBottom: "8px",
    cursor: "pointer",
    transition: "color 0.3s",
  },
  text: {
    margin: "5px 0",
    fontSize: "14px",
  },
  socialIcons: {
    display: "flex",
    gap: "12px",
    marginTop: "8px",
  },
  icon: {
    fontSize: "18px",
    cursor: "pointer",
    transition: "all 0.3s",
  },
  copy: {
    textAlign: "center",
    marginTop: "30px",
    fontSize: "14px",
    borderTop: "1px solid rgba(255,255,255,0.3)",
    paddingTop: "15px",
  },
};
